import styled from "styled-components/native";

export const Container = styled.View`
  margin-top: 25px;
  padding: 0 16px;
`;

export const Header = styled.View`
  height: 50px;
  background: red;
  justify-content: center;
`;

export const Title = styled.Text`
  color: #fff;
`;
